import React, { Component } from "react";
import Nav from "./components/Nav";
import Header from "./components/Header";
import { BrowserRouter as Router, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <div>
        <Nav />
        <Header />
      </div>
    </Router>
  );
}

export default App;
